        const expenseData = {
        ...enteredExpenseData,
        id:Math.random.toString()
        }
        console.log(expenseData);
    }

  return (
    <div className={classes['new-expense']}>
        <ExpenseForm onSaveExpense={saveExpenseDataHandler}/>
    </div>
   
  )
}

